const Dashboard = () => {
  return (
    <div>
      <h1>This is the initial page. Navigate to:</h1>
      <ul>
        <li>
          <a href="./SocketNav">Socket Navigation</a>
        </li>
        <li>
          <a href="./S2t">Speech to text</a>
        </li>
        <li>
          <a href="./Recording">Recording</a>
        </li>
      </ul>
    </div>
  );
};

export default Dashboard;
